import logo from './assets/PokeTrumps logo.png';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
        <img src={logo} className="App-logo" alt="logo" style={{ width:350, height: 100 }} />
        <p>
          Edit <code>src/App.js</code> and save to reload Kirsty's app.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
